import React from 'react'
import '../styles/Output.css'

const Output = props => {
    return(
        <div className='OutputWrapper'>
            { props.bits.map(bit => <span className='Bits' key={ Math.floor( Math.random() * 1000 ) }>{ bit }</span>) }
        </div>
    )
}

export default Output
